import java.io.*;

public class WormixMaster {
    static int[] points;
    static int[] times;
    static int V;

    public static void main(String[] args) throws IOException {
        BufferedReader in = null;
        in = new BufferedReader(new InputStreamReader(System.in));
        String[] init = in.readLine().split(" ");
        int n = Integer.parseInt(init[0]);
        V = Integer.parseInt(init[1]);
        points = new int[n];
        times = new int[n];
        int maxTime = 0;
        for (int i = 0; i < n; i++) {
            init = in.readLine().split(" ");
            points[i] = Integer.parseInt(init[0]);
            times[i] = Integer.parseInt(init[1]);
            maxTime += times[i];
        }

        int[][] table = new int[n+1][maxTime];

        for (int i = 1; i <=n; i++) {
            for (int j = 0; j < maxTime; j++) {
                if (times[i-1] > j) {
                    table[i][j] = table[i - 1][j];
                } else {
                    table[i][j] = Math.max(table[i - 1][j], table[i - 1][j - times[i-1]] + points[i-1]);
                }
            }
        }
        for(int i = 0; i < maxTime; i++){
            if(table[n][i]>=V){
                System.out.println(i);
                System.exit(0);
            }
        }
        System.out.println("-1");
    }


}

public Iterator<Key> iterator() {
        return new IteratorBST();
    }

    private class IteratorBST implements Iterator<Key> {
        private Stack<Node> stack = new Stack<Node>();

        IteratorBST() {
            Node node = root;
            while (node != null) {
                stack.push(node);
                node = node.left;
            }
        }

        public boolean hasNext() {
            return !stack.isEmpty();
        }

        public void remove() {
        }

        public Key next() {
            if (!hasNext()) throw new NoSuchElementException();
            Node node = stack.pop();
            Key key = node.key;
            node = node.right;
            while (node != null) {
                stack.push(node);
                node = node.left;
            }
            return key;
        }
    }

import java.util.Scanner;

public class IceCream {

    private static int  k, n, Left, Right, m[];

    public static void main(String[] args) throws Exception {
        Scanner in = new Scanner(System.in);
        while (in.hasNextInt()) {
            n = in.nextInt();
            k = in.nextInt();
            m = new int[n];
            for (int i = 0; i < n; i++) {
                m[i] = in.nextInt();
            }

            Left = 0;
            Right = m[n - 1];
            while (Left <= Right) {
                int Middle = (Left + Right) / 2;
                if (Check(Middle)) Left = Middle + 1;
                else Right = Middle - 1;
            }
            System.out.println(Left - 1);

        }
    }
    private static boolean Check(int Value) {
        int stall = 1;
        int len = 0;
        for (int i = 1; i < n; i++) {
            len += m[i] - m[i - 1];
            if (len >= Value) {
                len = 0;
                stall++;
            }
        }
        return stall >= k;
    }
}

