public class CacheFactorial {


    public static BigInteger[] fact = new BigInteger[21];

    private BigInteger mFactorial = BigInteger.valueOf(1);
    private BigInteger alreadyCalculated;
    private int order;



    public CacheFactorial (int n) {


        System.out.println((Arrays.stream(fact).toList())); //—â–æ–± –ø–æ–¥–∏–≤–∏—Ç–∏—Å—è –º–∞—Å–∏–≤

        if (n == 0) {
            fact[0] = BigInteger.valueOf(1);
        } else if (n == 1) {
            fact[1] = BigInteger.valueOf(1);
        } else {


            for (int i = 0; i < 21; i++) {

                if (i <= n && fact[i] != null) {
                    alreadyCalculated = fact[i];
                    order = i;

                }

            }

            fact[n] = computeFactorial(n, order, alreadyCalculated);
            mFactorial = computeFactorial(n, order, alreadyCalculated);
            //System.out.println((Arrays.stream(fact).toList())); //—â–æ–± –ø–æ–¥–∏–≤–∏—Ç–∏—Å—è –º–∞—Å–∏–≤
        }
    }


    public BigInteger getmFactorial(){
        return mFactorial;
    }




    private BigInteger computeFactorial(int n, int order, BigInteger alreadyCalculated) {
        int dif = n-order;

        for (int i=1; i<=dif; i++){
            if (alreadyCalculated!=null) {
                mFactorial = alreadyCalculated.multiply(BigInteger.valueOf(order + i));
                alreadyCalculated = mFactorial;
            } else {
                justFactorial(n);
            }
        }
        return mFactorial;
    }

    private Object justFactorial(int n) {

            if (n>1){
